import React, { Component } from 'react'
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      page : 'main',
      loading : true,
      person : null
    }
  }

  async componentDidMount() {
    const url = "http://localhost:8000/users";
    const response = fetch(url);
    const data = (await response).json();

    this.setState({loading : false , person : data});
    console.log(data.pesult);
  }

  render() {
    return (
      <div className = 'App'>
        <header><h1>Welcome to Crud Application</h1></header>
        <div>
          {
            this.state.page === 'main' ? 
            <div>
              <form>

                <div className='form-content' >
                  <label>Name : </label>
                  <input className='write' type = 'text' placeholder = 'Full Name'/><br />
                </div>

                <div> 
                  <label>Email : </label>
                  <input className='write' type = 'email' placeholder = 'Email'/><br />
                </div> 

                <div>
                  <label> Age : </label>
                  <input className='write' type = 'text' placeholder = 'Full Name'/><br />
                </div>

                <button type = 'submit'>Insert User</button>
              </form>
            </div>
            :
            <h1>Abhi poora kr rhe</h1>
          }

        </div>



      </div>
    )
  }
}

export default App;
